INSERT [dbo].[Products] ([ProductID], [ProductName], [Alias], [ProductCategoryID], [ThumbnailImage], [CalculationUnit], [Price], [OriginalPrice], [PromotionPrice], [IncludedVAT], [Warranty], [Description], [FullDescription], [ViewCount], [Tags], [IsDeleted], [IsBuy], [CreatedDate], [CreatedBy], [UpdatedDate], [UpdatedBy], [ManufactureID], [HotFlag], [Quantity]) VALUES (N'aa83a2ed-e7b0-4e9e-ae93-f15779c7233f', N'Máy tính bảng iPad Wifi Cellular 32GB (2017)', N'may-tinh-bang-ipad-wifi-cellular-32gb-2017-', N'7266b6f7-e191-4cfb-a87b-d91777d5c497', N'/Assets/UploadedFiles/files/ipad-wifi-cellular-32gb-2017-400-400x460.png', N'Chiếc', CAST(13000000.00 AS Decimal(18, 2)), CAST(10000000.00 AS Decimal(18, 2)), CAST(12000000.00 AS Decimal(18, 2)), 0, 12, NULL, N'<div class="boxArticle">
<h2>D&ograve;ng m&aacute;y t&iacute;nh bảng iPad 9.7 inch NEW (2017)&nbsp;mới của Apple sở hữu cho m&igrave;nh cấu h&igrave;nh mạnh mẽ c&ugrave;ng mức gi&aacute; b&aacute;n rất hấp dẫn.</h2>

<h3><strong>Thiết kế sang trọng</strong></h3>

<p>Với chất liệu kim loại nguy&ecirc;n khối sang trọng, c&aacute;c chi tiết được gia c&ocirc;ng tỉ mỉ, tinh xảo khiến iPad đến nay vẫn được rất nhiều người y&ecirc;u th&iacute;ch với vẻ ngo&agrave;i cuốn h&uacute;t của n&oacute;.</p>

<p style="text-align:center"><a class="preventdefault" href="https://www.thegioididong.com/images/522/101836/ipad-wifi-cellular-32gb-20171.jpg" onclick="return false;"><img alt="Nhiều màu sắc thời trang" class="lazy" src="https://cdn4.tgdd.vn/Products/Images/522/101836/ipad-wifi-cellular-32gb-20171.jpg" style="display:block" title="Nhiều màu sắc thời trang" /></a></p>

<p style="text-align:center"><em>Nhiều m&agrave;u sắc thời trang</em></p>

<p>Phần mặt lưng được bo cong gi&uacute;p bạn cầm thiết bị thoải m&aacute;i hơn, kh&ocirc;ng bị cấn tay hay g&acirc;y cảm gi&aacute;c kh&oacute; chịu.</p>

<p style="text-align:center"><a class="preventdefault" href="https://www.thegioididong.com/images/522/101836/ipad-wifi-cellular-32gb-20172.jpg" onclick="return false;"><img alt="Độ hoàn thiện cao" class="lazy" src="https://cdn1.tgdd.vn/Products/Images/522/101836/ipad-wifi-cellular-32gb-20172.jpg" style="display:block" title="Độ hoàn thiện cao" /></a></p>

<p style="text-align:center"><em>Độ ho&agrave;n thiện cao</em></p>

<p>Ph&iacute;m Home của m&aacute;y vẫn được t&iacute;ch hợp khả năng nhận diện v&acirc;n tay gi&uacute;p bạn mở kh&oacute;a thiết bị nhanh ch&oacute;ng.&nbsp;Tuy nhi&ecirc;n so với thế hệ&nbsp;<a href="https://www.thegioididong.com/may-tinh-bang/ipad-air-2-cellular-128gb" target="_blank" title="Thông tin iPad Air 2">iPad Air 2</a>&nbsp;th&igrave; thế hệ iPad 2017 lại c&oacute; trọng lượng nặng hơn v&agrave; d&agrave;y hơn đ&ocirc;i ch&uacute;t.</p>

<p style="text-align:center"><a class="preventdefault" href="https://www.thegioididong.com/images/522/101836/ipad-wifi-cellular-32gb-20173.jpg" onclick="return false;"><img alt="iPad 2017 bên phải có phần dày hơn người tiền nhiệm" class="lazy" src="https://cdn3.tgdd.vn/Products/Images/522/101836/ipad-wifi-cellular-32gb-20173.jpg" style="display:block" title="iPad 2017 bên phải có phần dày hơn người tiền nhiệm" /></a></p>

<p style="text-align:center"><em>iPad 2017 b&ecirc;n phải c&oacute; phần d&agrave;y hơn người tiền nhiệm</em></p>

<h3><strong>Cấu h&igrave;nh mạnh mẽ hơn</strong></h3>

<p>Với con chip Apple A9&nbsp;2 nh&acirc;n 64-bit, 1.84 GHz, RAM 2 GB kết hợp với hệ điều h&agrave;nh iOS mượt m&agrave; sẽ mang lại cho bạn trải nghiệm mượt m&agrave; v&agrave; trơn tru m&agrave; kh&oacute; c&oacute; thiết bị n&agrave;o c&ugrave;ng ph&acirc;n kh&uacute;c c&oacute; thể đem lại.</p>

<p style="text-align:center"><a class="preventdefault" href="https://www.thegioididong.com/images/522/101836/ipad-wifi-cellular-32gb-20176.jpg" onclick="return false;"><img alt="Cấu hình khủng, đáp ứng mọi nhu cầu sử dụng của người dùng" class="lazy" src="https://cdn.tgdd.vn/Products/Images/522/101836/ipad-wifi-cellular-32gb-20176.jpg" style="display:block" title="Cấu hình khủng, đáp ứng mọi nhu cầu sử dụng của người dùng" /></a></p>

<p style="text-align:center"><em>Cấu h&igrave;nh khủng, đ&aacute;p ứng mọi nhu cầu sử dụng của người d&ugrave;ng</em></p>

<h3><strong>M&agrave;n h&igrave;nh hiển thị đẹp</strong></h3>

<p>Với k&iacute;ch thước 9.7 inch kết hợp với tấm nền&nbsp;<a href="https://www.thegioididong.com/tin-tuc/cac-cong-nghe-hien-thi-tren-man-hinh-laptop-597377#ledbacklit" target="_blank" title="Tìm hiểu LED backlit LCD">LED backlit LCD</a>&nbsp;độ ph&acirc;n giải&nbsp;1536 x 2048 pixels&nbsp;vẫn mang lại cho bạn khả năng hiển thị h&igrave;nh ảnh trung thực, sắc n&eacute;t c&ugrave;ng g&oacute;c nh&igrave;n rộng.</p>

<p style="text-align:center"><a class="preventdefault" href="https://www.thegioididong.com/images/522/101836/ipad-wifi-cellular-32gb-20174.jpg" onclick="return false;"><img alt="Màn hình vẫn cho chất lượng tốt dù bị cắt giảm đôi chút" class="lazy" src="https://cdn2.tgdd.vn/Products/Images/522/101836/ipad-wifi-cellular-32gb-20174.jpg" style="display:block" title="Màn hình vẫn cho chất lượng tốt dù bị cắt giảm đôi chút" /></a></p>

<p style="text-align:center"><em>M&agrave;n h&igrave;nh vẫn cho chất lượng tốt d&ugrave; bị cắt giảm đ&ocirc;i ch&uacute;t</em></p>

<p>Đ&aacute;ng tiếc l&agrave;<a href="https://www.thegioididong.com/tin-tuc/cac-cong-nghe-hien-thi-tren-man-hinh-laptop-597377#ledbacklit" target="_blank" title="Tìm hiểu LED backlit LCD">&nbsp;</a><a href="https://www.thegioididong.com/may-tinh-bang-apple-ipad" target="_blank" title="Máy tính bảng Apple">Apple</a>&nbsp;đ&atilde; loại bỏ đi c&ocirc;ng nghệ chống ch&oacute;i l&agrave;m giảm đi khả năng hiển thị của m&aacute;y dưới điều kiện &aacute;nh s&aacute;ng mạnh.</p>

<h3><strong>Kết nối 4G tốc độ cao</strong></h3>

<p>M&aacute;y được t&iacute;ch hợp khe cắm sim, hỗ trợ kết nối&nbsp;<a href="https://www.thegioididong.com/hoi-dap/4g-la-gi-731757" target="_blank" title="Tìm hiểu LTE Cat 4">LTE Cat 4</a>&nbsp;gi&uacute;p bạn thoải m&aacute;i lướt facebook, chơi c&aacute;c tựa game online mọi l&uacute;c mọi nơi m&agrave; kh&ocirc;ng phải phụ thuộc v&agrave;o kết nối wifi.</p>

<p style="text-align:center"><a class="preventdefault" href="https://www.thegioididong.com/images/522/101836/ipad-wifi-cellular-32gb-20177.jpg" onclick="return false;"><img alt="Có kết nối 4G tiện lợi" class="lazy" src="https://cdn4.tgdd.vn/Products/Images/522/101836/ipad-wifi-cellular-32gb-20177.jpg" style="display:block" title="Có kết nối 4G tiện lợi" /></a></p>

<p style="text-align:center"><em>C&oacute; kết nối 4G tiện lợi</em></p>

<h3><strong>Camera chụp ảnh đẹp</strong></h3>

<p>M&aacute;y vẫn sở hữu camera độ ph&acirc;n giải 8 MP, khẩu độ F/2.4, c&oacute; lấy n&eacute;t tự động v&agrave; chống rung điện tử mang lại cho bạn những bức ảnh với chi tiết sắc n&eacute;t, &iacute;t bị nh&ograve;e khi rung tay.</p>

<p style="text-align:center"><a class="preventdefault" href="https://www.thegioididong.com/images/522/101836/ipad-wifi-cellular-32gb-201716.jpg" onclick="return false;"><img alt="Camera vẫn tốt dù chỉ có độ phân giải 8 MP" class="lazy" src="https://cdn1.tgdd.vn/Products/Images/522/101836/ipad-wifi-cellular-32gb-201716.jpg" style="display:block" title="Camera vẫn tốt dù chỉ có độ phân giải 8 MP" /></a></p>

<p style="text-align:center"><em>Camera vẫn tốt d&ugrave; chỉ c&oacute; độ ph&acirc;n giải 8 MP</em></p>

<p>M&aacute;y cũng hỗ trợ chụp ảnh Live Photo, quay video Slow Motion ở tốc độ 120 fps mang lại cho người d&ugrave;ng những đoạn video th&uacute; vị.</p>

<p style="text-align:center"><a class="preventdefault" href="https://www.thegioididong.com/images/522/101836/ipad-wifi-cellular-32gb-201713.jpg" onclick="return false;"><img alt="Ảnh chụp với điều kiện ánh sáng ban ngày" class="lazy" src="https://cdn3.tgdd.vn/Products/Images/522/101836/ipad-wifi-cellular-32gb-201713.jpg" style="display:block" title="Ảnh chụp với điều kiện ánh sáng ban ngày" /></a></p>

<p style="text-align:center"><em>Ảnh chụp với điều kiện &aacute;nh s&aacute;ng ban ng&agrave;y</em></p>

<p>Camera trước vẫn giữ nguy&ecirc;n độ ph&acirc;n giải chỉ 1.2 MP nhưng mang lại cho bạn chất lượng ảnh rất tốt, m&agrave;u sắc h&agrave;i h&ograve;a.</p>

<h3><strong>Dung lượng pin lớn</strong></h3>

<p>So với iPad Air 2 th&igrave; iPad mới cũng được Apple cải thiện dung lượng pin l&ecirc;n mức&nbsp;8610 mAh đem lại thời gian sử dụng đ&atilde; rất tốt nay c&ograve;n tốt hơn nữa.</p>

<p style="text-align:center"><a class="preventdefault" href="https://www.thegioididong.com/images/522/101836/ipad-wifi-cellular-32gb-201710.jpg" onclick="return false;"><img alt="Thời gian sử dụng thoải mái, kéo dài nhiều ngày" class="lazy" src="https://cdn.tgdd.vn/Products/Images/522/101836/ipad-wifi-cellular-32gb-201710.jpg" style="display:block" title="Thời gian sử dụng thoải mái, kéo dài nhiều ngày" /></a></p>

<p style="text-align:center"><em>Thời gian sử dụng thoải m&aacute;i, k&eacute;o d&agrave;i qua nhiều ng&agrave;y</em></p>

<p>Vốn đ&atilde; được nhiều người d&ugrave;ng y&ecirc;u th&iacute;ch v&agrave; sử dụng th&igrave; giờ đ&acirc;y với mức gi&aacute; b&aacute;n tốt hơn, cấu h&igrave;nh mạnh mẽ hơn th&igrave;&nbsp;iPad Wifi Cellular 32GB (2017) hứa hẹn sẽ lại đem về th&agrave;nh c&ocirc;ng lớn cho Apple.</p>

<p style="text-align:right"><strong>Ho&agrave;ng Quốc Tu&acirc;n</strong></p>

